  true,\n\t\"url\": null,\n\t\"notes\": \"Multiple Encounter Dataset (MEDS-I) is a
  test corpus organized from an extract of submissions of deceased persons with prior
  multiple encounters. MEDS is provided to assist the FBI and partner organizations
  refine tools, techniques, and procedures for face recognition as it supports Next
  Generation Identification (NGI), forensic comparison, training, and analysis, and
  face image conformance and inter-agency exchange standards. The MITRE Corporation
  (MITRE) prepared MEDS in the FBI Data Analysis Support Laboratory (DASL) with support
  from the FBI Biometric Center of Excellence.\",\n\t\"license_title\": \"Other License
